import React from "react";
import Navbar from "../components/Navbar/Navbar";
import styled from "styled-components";

const Container = styled.div``;
const Wrapper = styled.div``;
const Title = styled.div``;

function Cart() {
  return (
    <Container>
      <Navbar />
      <Wrapper>
        <Title></Title>
      </Wrapper>
    </Container>
  );
}
export default Cart;
